contracts/Reword.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface IERC20 {
    function transferFrom(address sender, address recipient, uint amount) external returns (bool);
    function transfer(address recipient, uint amount) external returns (bool);
    function balanceOf(address account) external view returns (uint256);
    function approve(address spender, uint value) external returns (bool);
    function decimals() external view returns (uint8);
}

contract REWORD {
    IERC20 private token;
    uint public reward;
    string[] public licenses;

    mapping (string => bool) public isLicense;
    mapping (address => uint) public claim_list;
    mapping (string => address) public license_bind;

    constructor(
        // address _owner, 
        // address _controller, 
        address _token) {
        // controller = _controller;
        // isController[_controller] = true;

        token = IERC20(_token);
    }

    // 授权绑定
    function bind(string calldata _license, address _address) public {
        require(isLicense[_license], "This license is not allowed.");
        if (_address == address(0)) {
            license_bind[_license] = msg.sender;
        } else {
            license_bind[_license] = _address;
        }
    }

    // 分配奖励（可能出现分配问题）
    function distribution() public {
        for (uint i = 0; i < licenses.length; i++) {
            address _address_reward = license_bind[licenses[i]];
            if (_address_reward != address(0)) {
                claim_list[_address_reward] += reward;
            }
        }
    }

    // 获取收益
    function getReward() public view returns (uint) {
        return claim_list[msg.sender];
    }

    // 提款
    function claim() public payable {
        token.transfer(msg.sender, claim_list[msg.sender]);
    }
}

